import React from "react";

function SearchBar() {
  return (
    <div className="searchbar">
      <div>
        <h1
          style={{
            display: "flex",
            justifyContent: "space-evenly",
            margin: "10px",
          }}
        >
          Weather Data
        </h1>
      </div>
      <div>
        <input
          type="text"
          value={this.state.userChoice}
          onChange={this.updateLocation}
        />
        <button type="submit" onClick={this.onSubmitted}>
          Search
        </button>
      </div>
    </div>
  );
}

export default SearchBar;
